import React from 'react';
import { Text, StyleSheet, View, Button, TouchableOpacity, TextInput } from 'react-native';

const LoginScreen = ({ navigation }) => {
  return (
    <View>
      <Text style={styles.text}>Near me</Text>
      <Text>Email</Text>
      <TextInput 
      style={styles.input} 
      autoCapitalize="None"
      autoCorrect={false}/>
      <TouchableOpacity>
        <Text>Don't have an account? sign in with us here!</Text>
      </TouchableOpacity>

      <Text>Password</Text>
      <TextInput style={styles.input} />
      <TouchableOpacity>
        <Text>Forgot password</Text>
      </TouchableOpacity>

      <Button
        onPress={() => navigation.navigate('Canteen')}
        title="Login"
      />
      <TouchableOpacity onPress={() => navigation.navigate('Menu')}>
        <Text>menu</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30,
  },
  input: {
      margin: 15,
      borderColor: 'black',
      borderWidth: 1
  }
});

export default LoginScreen;
